import React, { useState } from 'react'

export const Singlepage = () => {
    const [inputtagvalue,setInputtagvalue] = useState('')
    const [inputtagarray,setInputtagarray] = useState([])
    console.log(inputtagarray)
    const savingarray =()=>{
        setInputtagarray([...inputtagarray,{id:inputtagarray.length,name:inputtagvalue}])
    }
    const [change,setChange] = useState('0')

    function decrement(){
      setChange(change-1)
    }
    
  
  return (
    <div>
   <input type="text" onChange={(event)=>setInputtagvalue(event.target.value)}/>
    <input type="submit" onClick={()=>savingarray()} />
    <button onClick={decrement}>-</button>
    {change}
    <button onClick={increment}>+</button>




    </div>
 
  )
}
